import React from 'react'
import './App.css'
import { Button } from 'react-bootstrap';

class Subsection extends React.Component {





	render() {
		var data = this.props.data;

		return (
			<div>
				<li>{data.number} <Button> Add Subsection </Button></li>
				<ul>
					<li>{data.location}</li>
					<li>Meeting Times</li>
				</ul>
			</div>
		)
	}
}

export default Subsection;
